import React from 'react';
import { FormGroup, Label, Input, FormText } from 'reactstrap';

const Female = (props) => {
  return (
    <div>
      <br />
      <FormGroup check>
        <Label check>
          <Input type="checkbox" name="potential" />{' '}
          I could become pregnant
          </Label>
      </FormGroup>
      <FormGroup check>
        <Label check>
          <Input type="checkbox" name="pregnant" value = "2"/>{' '}
          I am pregnant now
          </Label>
      </FormGroup>
      <FormGroup check>
        <Label check>
          <Input type="checkbox" name="noplan" value = "4"/>{' '}
          I am not planning to become pregnant
          </Label>
      </FormGroup>
      <FormGroup check>
        <Label check>
          <Input type="checkbox" name="cannot" value="4" />{' '}
          I could not become pregnant
          </Label>
      </FormGroup>
    </div>
  );
};

export default Female;
